away from Newton MRT Station on foot. This means that access to the North-South Line and the Downtown Line is just a short walk away.\n\nThe Central Business District, accessible via Raffles Place MRT Station, is only five MRT stops away. On day-offs, whether you are thinking about shopping at Orchard Road (one MRT stop away on the North-South Line) or surrounding yourself with flora and fauna at Botanic Gardens (two MRT stops away on the Downtown Line), you are well-placed to choose.\n\nBeing within a 1km-radius of reputable primary schools such as ACS (Barker Road), ACS Junior and SJI Junior, Kopar at Newton is a great base for a growing young family.\n\nCall Propnex Renee to book exclusive appointment to view Kopar@Newton.\n                                    Read More\n                            ','\n            \n                Air-Conditioning,Balcony,Cooker Hob/Hood,Dryer,Fridge,Intercom,Oven / Microwave,Renovated,Washing Machine\n                \n            \n            ','https://www.propertyguru.com.sg/listing/23803323/for-sale-kopar-at-newton','Kopar At Newton, 4 Makeway Avenue, 4 Bedrooms, 1604 sqft, Condos & Apartments for sale, by Renee Yap, S$ 3,900,000, 23803323','Condominium','\n                        Renee Yap\n                        \n                    ','ERA REALTY NETWORK PTE LTD'),
