ation\n\n\n.\n                                    Read More\n                            ','\n            \n                Car Park\n                \n            \n            ','https://www.propertyguru.com.sg/listing/24200596/for-sale-sembawang-springs-estate','Sembawang Springs Estate, Jalan Salang, 5 Bedrooms, 2200 sqft, Landed Properties for sale, by Rosalind Lee, S$ 3,400,000, 24200596','','\n                        Rosalind Lee\n                        \n                    ','PROPNEX REALTY PTE. LTD.'),
